pragma solidity 0.5.1;

/**
 * @title Abstractable
 * @dev Implementation of the Abstractable contract
 */

contract Abstractable {

    mapping(bytes32 => address) private permissions;

    function getContractAddress(bytes memory _code, address _signer, uint256 _salt) public view returns (address) {
        bytes32 result = keccak256(
            abi.encodePacked(bytes1(0xff),
            address(this),
            keccak256(abi.encodePacked(_signer, _salt)),
            keccak256(_code)
            )
        );
        address ret;
        uint mask = 2 ** 160 - 1;
        // solhint-disable-next-line no-inline-assembly
        assembly {
            ret := and(result, mask)
        }
        return ret;
    }

    function getDeployedAddress(address _signer, uint256 _salt) public view returns (address) {
        bytes32 actualHash = keccak256(abi.encodePacked(_signer, _salt));
        return permissions[actualHash];
    }

    function _deployContract(bytes memory _code, address _signer, uint256 _salt) internal returns (address addr) {
        bytes32 actualHash = keccak256(abi.encodePacked(_signer, _salt));
        bool failed;
        if (permissions[actualHash] != address(0x0)) {
            return addr = address(0x0);
        }
        // solhint-disable-next-line no-inline-assembly
        assembly {
            addr := create2(0, add(_code, 0x20), mload(_code), actualHash)
            failed := iszero(extcodesize(addr))
        }
        if (failed)
            return addr = address(0x0);

        permissions[actualHash] = addr;
    }
}

